    "wolf-and-barren-ground-caribou-relationship-headwaters-of-the-gulkana-and-susitna-rivers",nt"isopen":
    false,nt"url": null,nt"notes": "The caribou population in the area south
    of the Alaska Range, extending north and east to the Wrangell Mountains and embracing
    sane 9, 000 square miles of varying topography, is commonly called the Nelchina
    Herd. The wolf has always been associated with the caribou herds of this area. Wolf
    numbers have fluctuated as disease and their food supply added or subtracted from
    their reproductive capacity. Since mass hunting pressure has been in vogue on caribou
    the past few years, many animals have been wounded or crippled by hunters. These
    cripples are easy victims for the predators and many kills that are attributed to
    the wolf are often animals that have died frau the result of gunshot wounds. Only
    when the wolf increases in numbers so that they impose a serious threat to the future
    of big game, should controls be initiated.",nt"license_title": "License Not
